script: |
  super -f text -I q13432.spq | sort > q13432.out

inputs:
  - name: q13432.spq
    data: |
      SELECT DISTINCT 86 AS col2, + 19 + col0 - + + 93 + col2 / + col0 * - - 10 * + 88 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q13432.out
    data: |
      86	-10
      86	-28
      86	1
